INSERT INTO `categories` VALUES (2,NULL,'Kitchen doors','kitchen-doors','KITCHENIN takes pride in their wide selection of kitchen doors and cabinets. You can enjoy various finishes and styles, a wonderful selection of materials and beautiful colours to choose from. KITCHENIN makes it easy for you to create your dream kitchen - from idea to reality. We stand behind our products by working with some of the best English and Italian factories to produce kitchen doors and cabinets. \r\nWhen you choose KITCHENIN , you’ll never be disappointed. We provide you to choose your beautiful kitchen that matches your home’s look, style, decor, and budget. Do you have ideas, but aren’t sure where to start? Do you like your kitchen, but hate your kitchen doors or cabinets? Is your kitchen functional, but old fashioned? So say goodbye to your outdated kitchen! Here at KITCHENIN, you can create the kitchen of your dreams. Thanks to modern production, custom made Kitchen Doors are more cost-effective than ever, while maintaining the best quality. Our high quality brands are not the only thing we are proud of when it comes to kitchen doors and kitchen cabinets. We want you to be so happy with the work on renovating your kitchen, so we only use proven brands for all our customers.\r\nYou want to make your kitchen stylish and modern? Then you have to choose our stunning High Gloss and Matt Collections. These High Gloss Doors and Matt Doors make your kitchen look luxurious and desirable. When choosing these contemporary doors, we offer you any colours, any standard sizes and Made to Measure at an affordable price.\r\nWe offer you our Woodgrain Collection in which you can find your new kitchen. By choosing Woodgrain Doors you can enable your kitchen with a warm look and cosiness, created by the wood. You can assemble different combinations of Woodgrain Doors, High Gloss Doors and Matt Doors and to give your kitchen a unique and incredible finish. There is a wide range of any colours, any standard sizes and Made to Measure.\r\nIn our Traditional Collection you can find  a variety of many Traditional Doors and many interesting details, which can make your kitchen radiate a subtle sense of the past and still be as intricate and stylish. A very big choice of styles and neutral, soft colours such as: neutral oak, off-white, cool greys, and many others. Available in any standard sizes and Made to Measure.\r\nIf you choose our Handleless Collection you will give your kitchen a sophisticated look which compliments each individual style of kitchen. With an ultra-modern J-pull handleless door, which enables you to always keep your doors clean and shiny. This 22mm J-pull handleless kitchen door is available in different selection of colours any standard sizes, with an astonishing low price.',1,'2018-05-29 13:00:35','2018-10-08 21:17:32',NULL,1),(3,NULL,'Kitchen units','kitchen-units','<div class=\"row\">\r\n    <div class=\"col-xs-4\">\r\n        <iframe src=\"https://www.youtube.com/embed/9i9CiN1MCAI\" width=\"360\" height=\"300\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe>\r\n    </div>\r\n    <div class=\"col-xs-4\" style=\"margin-bottom: 30px;\">\r\n<p>The ClicBox Kitchen Range is an entirely new concept in kitchen cabinets. Using the patented UNICLIC for furniture technology, means the different components just clic together. This is set to revolutionise kitchen installation.</p>\r\n<p>✓ Revolutionary new product to make kitchen cabinet assembly easier than ever before.</p>\r\n<p>✓ A stronger more stable cabinet.</p>\r\n<p>✓ Assembled five times quicker than normal.</p>\r\n<p>✓ Constructed from 18mm MFC with a solid 8mm back.</p>\r\n<p>✓ Requires no tools, no fittings and no glue.</p>\r\n<p>✓ In stock and available on 48hr despatch.</p>\r\n<p>✓ Suitable for use with the entire all door range. Clicks together...without tools.</p>\r\n    </div>\r\n    <div class=\"col-xs-4\">\r\n        <img src=\"/images/static/click.box.png\" alt=\"\" />\r\n    </div>\r\n</div>',2,'2018-05-30 05:05:10','2018-10-08 21:20:13',NULL,8),(4,NULL,'Essential components','essential-components',NULL,3,'2018-05-30 05:05:20','2018-10-08 21:20:24',NULL,9),(5,NULL,'Accessories','accessories','<p>CHOOSE YOUR NEW HANDLES, HINGES, DRAWER SYSTEMS AND INTERNAL STORAGES</p>',4,'2018-05-30 05:05:38','2018-10-08 21:20:59',NULL,10),(7,2,'High Gloss Doors','high-gloss-doors','The kitchen is the first place you should start with, if you have a home that needs renovation. Your kitchen  should be the heart of your home, the place where you will prepare culinary delights, but also a place that will gather friends, unite the whole family, solve your problems and your common future. Harmonious design will help you make your home a source of warmth, love and well-being. That\'s why it\'s important that your kitchen not only has everything to do in it but it becomes beautiful and functional place to enjoy. Renovating the kitchen, such as new kitchen cabinet doors, is one of the best ways to invest your money, as much of the cost is reflected in the increased value of your home.\r\nWe stand behind our products by working with some of the best English and Italian factories to produce kitchen doors and cabinets. Thanks to the modern production, custom-made kitchen cabinets are more cost-effective than ever, while maintaining the best quality and price. Our high quality brands are not the only thing we are proud of when it comes to kitchen doors and kitchen cabinets. We want you to be so happy with the work on renovating your kitchen, so we can assure you that we only use proven brands for all our customers. With the great variety of colour and style we offer, we strive to satisfy your wishes. Using your imagination, you can choose different styles and colours from our wide range of products, bring a more modern look at your new kitchen with curved doors and panels and turn your dream into reality.\r\n\r\nYour dreams are our inspiration!',1,'2018-05-30 05:09:44','2018-10-08 21:17:46',NULL,2),(8,2,'Matt Doors','matt-doors','Many families spend a lot of time in their kitchen, whether preparing or consuming food, planning their week or playing their favourite games around the kitchen table. The kitchen is the family heart, the centre where the family gathers and spends time together. That\'s why most people prefer to spare time to make their kitchen more  comfortable and cosy. Other want it to be modern and stylish. In other words the kitchen is the KEY towards each family. KITCHENIN can give you this KEY! KETCHENIN offers you a wide variety of products, such as our Matt Doors, made of quality materials, good finish and modern style. Our store can satisfy every client\'s wishes and claims. Want to make your new kitchen or to change the appearance of your old one and give it a new style, refinement and comfort or you want to make the kitchen you dream about, then you just have to do some very easy steps to do your order and make your dream come true.\r\nThere are no impossible things, with KITCHENIN you get it all!',2,'2018-05-30 05:10:32','2018-10-08 21:18:08',NULL,3),(9,2,'Woodgrain Doors','woodgrain-doors',NULL,3,'2018-05-30 05:10:54','2018-10-08 21:18:51',NULL,5),(10,2,'Traditional Doors','traditional-doors','We believe the kitchen is the heart of the home. Creating a beautiful kitchen that suits your home and taste will always add value to your house. Experience a feeling of warmth, tradition and style as soon as you step into one of our Traditional style doors. Do you love to entertain? From the moment your guests enter, it will be clear that your kitchen will be the scene for many a culinary masterpiece.There are 38 traditional types of doors to select from, each with an individual charm to suit your preference. This highly sophisticated style has many interesting design elements, which can be expertly made to measure, perfectly suited to your home and today’s modern lifestyle.This traditional style often uses soft, subtle colours such as cream, matt dakar, alabaster, neutrals oak, and off-whites. These colours are used to highlight the elaborate design elements of the unique style.\r\n\r\nIf Portsmouth’s coastal charm, English musings, or something more traditional is more your style, then, with our many door styles, multiple decorative features and limitless colour options, at KITCHENIN you can find everything you want. We take genuine pride in every item we offer. The elegant aesthetic may look simple, but every element is carefully considered. Every item is crafted from the finest environmentally friendly materials, using the latest state of the art equipment and then hand finished by our talented craftsmen.',4,'2018-05-30 05:13:04','2018-10-08 21:19:12',NULL,6),(11,2,'Paintable Doors','11-paintable-doors',NULL,5,'2018-05-30 05:13:22','2018-09-05 12:38:19','2018-09-05 12:38:19',0),(12,2,'Handleless Doors','handleless-doors','One of KITCHENIN\'s wishes is to offer you the wonderful design of kitchen doors. We are constantly updating new styles to improve functionality and efficiency. We present you an ultra-modern J-pull handleless door, original and beautiful, and the selection is varied, enabling you to compliment each individual style. These doors have a J-shaped groove that lets you put your hand in the trough, easily and gently to open your doors. So they always remain clean and glamorous. Our great variety of colour and style will make your choice easy.\r\n\r\nIf you want your new kitchen to have a clean and elegant design, modern and sophisticated vision, we at KITCHENIN strongly recommend that you choose a 22mm J-pull handleless kitchen door. So you can make your kitchen more than a kitchen- this is a way of life, exceptional value and investment in your home. We present unique products, high quality materials, panels and internal components at affordable prices.',6,'2018-05-30 05:14:05','2018-10-08 21:18:19',NULL,4),(13,5,'Hindges','13-hindges',NULL,1,'2018-05-30 05:15:33','2018-10-01 09:50:48',NULL,11),(14,5,'Handles','14-handles',NULL,2,'2018-05-30 05:16:00','2018-10-01 09:50:48',NULL,12),(30,5,'Drawer Systems','drawer-systems',NULL,3,'2018-05-30 05:16:13','2018-10-08 21:21:11',NULL,13),(31,5,'Internal Storages','internal-storages',NULL,4,'2018-05-30 05:16:22','2018-10-08 21:20:50',NULL,14),(32,5,'Door Lift Mechanisms','door-lift-mechanisms',NULL,5,'2018-05-30 05:16:33','2018-10-08 21:20:40',NULL,15),(33,2,'Hand Painted Doors','hand-painted-doors',NULL,5,'2018-10-01 09:48:11','2018-10-08 21:19:47',NULL,7);
