oposed delivery lead times are given only for guidance and they can change without notice</p>\r\n\r\n<p>We aim to deliver your online order within 14 days of purchase, depending on stock availability and the delivery address. We will deliver your order within 2-3 working days of dispatch, within 30 days of the order date unless otherwise agreed between us. Your order may arrive in more than one delivery.</p>','delivery-information','<p><strong>About these terms</strong><br />\r\nIf you have any further questions please visit our&nbsp;Delivery&nbsp;pages for more information.</p>\r\n\r\n<p><strong>Home</strong>&nbsp;<strong>Deliveries</strong></p>\r\n\r\n<p>We can deliver direct to your home.</p>\r\n\r\n<p>We will deliver the goods to the premises you specify on your order between 7:30am and 6:00pm Monday-Friday.</p>\r\n\r\n<p><strong>You are responsible for ensuring that you are available to accept delivery. If you are not, there must be an adult available who is capable of receiving delivery on your behalf, and you agree that we can rely on their instructions as if they were your own.</strong></p>\r\n\r\n<p><strong>Please ensure that the goods are signed for accordingly.</strong></p>\r\n\r\n<p>If there is no one to accept the order on the scheduled delivery date the goods may be returned to the factory and we reserve the right to charge you an additional re-delivery charge.<br />\r\nWe will not accept responsibility for loss or damage if the delivery company is instructed to leave the goods unattended.</p>\r\n\r\n<p>&nbsp;<strong>Delivery charges, delivery areas</strong></p>\r\n\r\n<p>Free delivery is available on orders where the goods cost more than &pound;300.00.&nbsp;<br />\r\nAdditional charges may apply if you mix doors from a number of different ranges as these may have to be treated as individual orders.</p>\r\n\r\n<p>We can deliver our products anywhere in mainland Great Britain and Republic of Ireland only, excluding any islands or the Highlands/Islands of Scotland.</p>\r\n\r\n<p>&nbsp;<strong>What information do we require from you?</strong></p>\r\n\r\n<p>When you arrange your delivery, we will ask you to provide certain information. This information will be recorded on the delivery document and the delivery will take place at the delivery address you specify. If you provide us with incomplete, incorrect or inaccurate information or instructions, we may cancel the delivery by giving you written notice</p>\r\n\r\n<p>&nbsp;<strong>Online delivery dates</strong></p>\r\n\r\n<p>You will automatically be allocated the earliest delivery date possible during the checkout stage. Proposed delivery lead times are given only for guidance and they can change without notice</p>\r\n\r\n<p>We aim to deliver your online order within 14 days of purchase, depending on stock availability and the delivery address. We will deliver your order within 2-3 working days of dispatch, within 30 days of the order date unless otherwise agreed between us. Your order may arrive in more than one delivery.</p>','2018-09-03 07:10:22','2018-09-19 15:03:32',NULL),(5,'Contact us','<div class=\"row\">\r\n<div class=\"col-sm-4\">\r\n<h2>Call us</h2>\r\n<p>\r\n<a href=\"tel:01708403806\">01708403806</a><br />\r\n(Lines open Monday - Friday 9am - 5.30pm)\r\n</p>\r\n</div>\r\n\r\n<div class=\"col-sm-4\">\r\n<h2>Email us</h2>\r\n<p><a href=\"mailto:info@kitchenin.co.uk\">info@kitchenin.co.uk</a></p>\r\n</div>\r\n\r\n<div class=\"col-sm-4\">\r\n<h2>Write to us</h2>\r\n<address>Customer Service&nbsp;<br />\r\nKitchenin<br />\r\n103 Corran Way&nbsp;<br />\r\nSouth Ockendon<br />\r\nEssex<br />\r\nRM15 6AP</address>\r\n</div>\r\n</div>','contact-us','<div class=\"row\">\r\n<div class=\"col-sm-4\">\r\n<h2>Call us</h2>\r\n<p>\r\n<a href=\"tel:01708403806\">01708403806</a><br />\r\n(Lines open Monday - Friday 9am - 5.30pm)\r\n</p>\r\n</div>\r\n\r\n<div class=\"col-sm-4\">\r\n<h2>Email us</h2>\r\n<p><a href=\"mailto:info@kitchenin.co.uk\">info@kitchenin.co.uk</a></p>